import React from "react";

// reactstrap components
import { Card, CardImg, CardImgOverlay, CardTitle, CardText } from "reactstrap";

function Details() {
  return (
    <>
      <Card className=" bg-dark text-white border-0">
        <CardImg
          alt="..."
          //src="https://demos.creative-tim.com/argon-dashboard-pro/assets/img/theme/img-1-1000x600.jpg"
          src={require('../../images/b.jpg')}
        ></CardImg>
        <CardImgOverlay className=" d-flex align-items-center">
          <div>
            {/* <CardTitle className=" h2 text-white mb-2">Welcome to Veggy</CardTitle>
            <button className="btn btn-success">Click ME</button>
            
            <CardText>
              It is in a testing phase to chek the flow.
            </CardText>
            <CardText className=" text-sm font-weight-bold">
              Last updated 3 mins ago
            </CardText> */}
            User Name: <input type="text" name="username" value={this.state.username} onChange={this.handleChange} />
                    Password: <input type="password" name="password" value={this.state.password} onChange={this.handleChange} />
                    <button className="btn btn-success" onClick={this.loginClicked}>Login</button>
          </div>
        </CardImgOverlay>
      </Card>
    </>
  );
}

export default Details;
